import React, { Component } from "react";
import HeartCounter from "./HeartCounter";

export default class ListItem extends Component {
    render() {
        return (
            <div class="image_div">
                <img src={this.props.src} alt="blah" class="image" />
                <div class="image_desc">
                    <h1>{this.props.name}</h1>
                    <p>{this.props.date}</p>
                    <h3 class="medium">{this.props.medium}</h3>
                    <h3>{this.props.award}</h3>
                    <HeartCounter text="Give it Love!" />
                </div>

            </div>
        )

    }
}
